import React from 'react'
import 'bootstrap/dist/css/bootstrap.css';
import '../../../../node_modules/font-awesome/css/font-awesome.min.css';
import '../CourseManager.css';
import CourseRowComponentStateful from "./CourseRowComponentStateful";

const CourseTableComponent = ({
  courses, onCourseTitleSelect, showCourseEditor,
  hideCourseEditor, deleteCourse
}) =>
    <div className="container-fluid">
      <h3>Course Table {courses.length}</h3>
      <ul className="list-group">
        {
          courses.map(course =>
              <CourseRowComponentStateful
                  key={course._id}
                  onCourseTitleSelect={onCourseTitleSelect}
                  showCourseEditor={showCourseEditor}
                  hideCourseEditor={hideCourseEditor}
                  deleteCourse={deleteCourse}
                  course={course}/>
          )
        }
      </ul>
    </div>;

export default CourseTableComponent
